Manuel Bretón de los Herreros (1796-1873) fue un dramaturgo, poeta y periodista español del Romanticismo, conocido principalmente por sus comedias de costumbres, aunque también escribió poesía lírica como este soneto. Este poema en particular es uno de sus sonetos más conocidos.
